import { DiBootstrap, DiCss3, DiHtml5, DiJavascript, DiReact } from "react-icons/di";

const Tech = () => {
  return (
    <div>
      <h1 className="text-center text-2xl font-semibold p-5"> Technologies I use</h1>
      <div id="icons" className="text-9xl flex justify-evenly">
        <DiHtml5 />
        <DiCss3 />
        <DiJavascript />
        <DiReact />
        <DiBootstrap />

      </div>
    </div>
  )
}
export default Tech
